import './Logo.css'

function Logo() {
    return (
        <div className="logo-container">
            <h1 className="logo-title-brand">
                <span className="logo-team">Team</span>
                <span className="logo-collab">Collab</span>
            </h1>
        </div>
    )
}

export default Logo
